const PreDefinedPath = ({ pathways }) => {
  const { id } = useParams();
console.log(id)
  // Find the selected pathway by id
  console.log(pathways[0].title)
  console.log(pathways[0].steps[0].id)
  return(
    <> 
    <h1>{pathways[id].title}</h1>
    {
      pathways[id].steps.map(step => {
        <li>{step}</li>
      })
    }
    </> 

  )
};

